                this.setState({
                  currVal: firstNumber * secondNumber,
                });
              } else if (val[1] === "/"){
                this.setState({
                  currVal: firstNumber / secondNumber,
                })}
                val = val.slice(3,);
                let op =''
                let num=''
                if(val.length>0){
                val.forEach((value)=>{
                  console.log(val)

                  if (value === "+") {
                    op = '+'

                  } else if (value === "-") {
                    op = '-'
