                    op = '*'
                  } else if (value === "/"){
                    op = '/'
                  } else if (parseInt(value) === typeof(3)){

                    if (op === "+") {
                      this.setState({
                        currVal: this.currVal + parseInt(value),
                      });
                    } else if (op === "-") {
                      this.setState({
                        currVal: this.currVal - parseInt(value),
                      });
                    } else if (op === "*") {
                      this.setState({
                        currVal: this.currVal * parseInt(value),
                      });
                    } else if (op === "/"){
                      this.setState({
                        currVal: this.currVal / parseInt(value),
                      })}




                  }


                })}










          }
          }
        calculate(props) {
          this.setState({});
        }

