                  this.operations("5");
                }}
              >
                5
              </button>{" "}
              <t />
              <button
                onClick={() => {
                  this.operations("6");
                }}
              >
                6
              </button>{" "}
              <t />
              <button
                onClick={() => {
                  this.operations(" - ");
                }}
              >
                -
              </button>{" "}
              <t />
